export default function GetGameData(data) {
    const instance = data;
    console.log(instance);
    console.log('Get Game Data');
    const opponent = null;
    if(instance.vls.ta === 'HOU') {
        opponent = instance.vls.tn;
    }
    else{
        opponent = instance.hls.tn;
    }
    const GameData = {
        'date': instance.gdte,
        'time': instance.utctm,
        'city': instance.ac,
        'state': instance.as,
        'opponent': opponent,
        'status': instance.st
    };

    return GameData;
}
